import React, { useEffect } from "react";
import { getAllProductsThunk } from "../Data/productThunk";

import Main from "./pages/Main";

import "./App.css";

const App = () => {


  useEffect(() => {
    dispatch(getAllProductsThunk(9));
  }, []);
  return (
    <div className="AppPage">
      <div className="AppPage_wrapper">
        <Main />
      </div>
    </div>
  );
};

export default App;
